// src/main.js
import Vue from 'vue';
import App from './App.vue';
import vuetify from './plugins/vuetify';
import VueRouter from 'vue-router';
import router from './router'; // Importe a configuração do Vue Router

Vue.config.productionTip = false;

// Use o VueRouter globalmente
Vue.use(VueRouter);

// Crie uma nova instância Vue
new Vue({
  // Conecte Vuetify à instância Vue
  vuetify,
  // Conecte o router à instância Vue
  router,
  // Função de renderização
  render: h => h(App),
  // Monte a instância Vue no elemento com o ID 'app'
}).$mount('#app');
